import React from 'react';
import './App.css';
import Login from './components/Login';
import Picture from './components/Picture';
import Register from './components/Register';
import { Provider } from 'react-redux'
import store from './redux/store'
import { Route, Switch,Redirect } from 'react-router-dom';
import TodayPicture from './components/TodayPicture';
import NavBar from './components/NavBar';
import HistoryPictuer from './components/HistoryPictuer';


export default function App(props) {
  return (
    <div className="App">
      <div className="container ">
        <div className="row ">

          <div style={{ display: "inline-block" }} className="col-12 justify-content-center‏">
            <Switch>
              <Route component={NavBar} path="/navbar" />
              <Route component={Register} path="/register" />

              <Route path="/login/todayPicture">
                {props.user != '' ?
                  <TodayPicture user={props.user}></TodayPicture>
                  :
                  <Redirect to="/Login" />}
              </Route>

              <Route path="/login/historyPicture">
                {props.user != '' ?
                  <HistoryPictuer user={props.user}></HistoryPictuer>
                  :
                  <Redirect to="/Login" />}

              </Route>
              <Route path="/login/picture" >
                {props.user != '' ?
                  <Picture user={props.user}></Picture>
                  :
                  <Redirect to="/Login" />}
              </Route>
              <Route component={Login} path="/" />
            </Switch>
          </div>
        </div>
      </div>
    </div>
  )
}
